{"reasoning":"The ground truth describes an unattended ATV that continuously circles in place and clips through a dead NPC’s body. There is no interaction with another vehicle and the key symptom is perpetual spinning/contact with a corpse. 

The generated report describes a different scenario: a stationary ATV is struck (or merely approached) by a car, after which it is launched upward and flips violently. The core trigger (car collision) and outcome (air-borne flipping) differ completely from circling in place and clipping through a body. No mention of dead NPC clipping or spinning is present.

Therefore, the two reports refer to different bugs.","match":false}

{"reasoning":"Ground truth bug: An enemy naturally spawns/stands behind a window-wall and becomes stuck; only part of its model (a hand) penetrates the solid surface. The key points are (1) enemy is stuck behind the wall, (2) partial clipping of body through window/wall, (3) no player interaction causes it – it is simply visible with a special vision ability.

Generated report: Enemy is first outside a window, then the player actively uses the Iron Arms pull ability; during that pull the entire enemy passes/clips through the window without the window reacting. The trigger (pull ability), amount of clipping (whole body passes), and behaviour (enemy moves through window) differ from the ground truth scenario of a stationary stuck enemy showing only a hand.

Although both involve an enemy intersecting a window, the circumstances and manifestations are different enough that they likely refer to different underlying bugs (one about spawn/pathing causing stuck clipping, the other about missing collision during a pull ability).","match":false}

{"reasoning":"Ground-truth focuses on a carriage that pops into existence in front of the mounted player, with the key problem being the sudden appearance/spawn that triggers an unavoidable collision and knocks the player off the horse.  

The generated report, while it also involves the player colliding with a carriage and being dismounted, identifies a different issue: the character’s ragdoll/physics model deforms unrealistically after the fall. It does not mention or revolve around the carriage spawning unexpectedly; instead, it treats the collision as an already-given circumstance and concentrates on post-collision animation/physics.  

Because the two descriptions highlight different faulty behaviors (unexpected spawn vs. ragdoll contortion), they do not describe the same underlying bug.","match":false}

{"reasoning":"Ground truth: after (or while) being on the train, the character’s lower body sinks through the floor – the torso is above the floor plane while the legs are inside it. Core symptom: vertical clipping into the train FLOOR.

Generated report: occurs when the player tries to GRAB the side of a moving train. The character fails the grab, ends up in an odd pose, and clips "into the train’s model." The emphasis is on a failed grab interaction and a general collision/animation break on the SIDE of the train, not specifically the character standing with legs sunk into the floor.

Although both mention some form of clipping with the train geometry, the situations and manifestations differ: ground-truth bug is persistent floor penetration; generated report is a transient grab animation/physics glitch. These are likely separate issues.","match":false}

{"reasoning":"Ground truth bug: the player hangs motionless in mid-air for a short time, then falls. Key symptom is a temporary suspension above ground before gravity resumes.

Generated report: when executing a Leap Attack on a flying enemy, both the player and the enemy are instantly teleported to the ground and the attack continues there. There is no mention of a pause/suspension in mid-air; instead the issue is an immediate repositioning to ground.

Trigger conditions and observed behavior are therefore different: mid-air freeze vs. instant ground teleport. Thus they do not describe the same underlying bug.","match":false}

{"reasoning":"The ground truth bug concerns NPCs that are continually bouncing or jumping into the air, with one reaching an abnormally high altitude. The key symptoms are repetitive jumping/physics glitches.

The generated bug report instead describes a single NPC that is statically positioned on top of a rock formation (an incorrect spawn location) with no mention of jumping, bouncing, or abnormal movement. The core issue here is placement/spawn rather than movement/animation.

Because the behaviors, symptoms, and likely causes are different (animation/physics vs. spawn/placement), the two reports do not describe the same underlying bug.","match":false}

{"reasoning":"Ground-truth bug: a character near a window is suddenly launched upward, ends up on the roof, and keeps walking there with one leg stuck in a bent pose. Key symptoms are the sudden projection event and the abnormal animation pose while the character moves on the roof.

Generated report: describes an NPC already on a roof who is hovering slightly above the roof surface and has a vertical white graphical line extending upward. It does not mention any sudden launch from a window or an abnormal leg pose; instead it introduces an additional graphical artifact (white line) not present in the ground-truth description.

Because the generated report lacks the launch/animation details that define the ground-truth bug and instead focuses on a different symptom (vertical line), they most likely refer to different underlying issues.","match":false}

{"reasoning":"Ground truth describes a bug where a helicopter spawns under the terrain, rises up (“emerges from the ground”), and kills the (still-alive) player. The core symptom is the helicopter coming out of the ground.

Generated report describes the helicopter already present above ground (landing/hovering on train tracks) whose model clips through a player character’s body during a kill-cam. It does not mention the helicopter emerging from beneath the ground or killing an active player; instead it focuses on model clipping with a downed character.

Because the fundamental behaviors and conditions differ (emerging from ground and killing vs. clipping through a downed body on tracks), they refer to different bugs.","match":false}

{"reasoning":"Ground truth bug concerns a scripted animation where the truck incorrectly becomes airborne and clips through a building interior. Key elements: occurs during animation sequence, truck floats/hovers, partial clipping with building walls.

Generated report concerns gameplay physics allowing the player-controlled truck to drive up stairs, implying incorrect collision/physics with stairs. No mention of animation sequence, floating, or clipping inside a building.

The core behaviors, triggers, and symptoms differ; therefore they are not the same bug.","match":false}

{"reasoning":"Ground-truth bug: the player’s movement on the boat makes the boat slide/shift forward and move around in the water. The key symptom is horizontal motion caused by the character’s walking.

Generated report: describes the boat sinking slightly and sitting partially submerged; it focuses on incorrect buoyancy, not on the boat being pushed/shifted by the character’s movement. It never mentions the boat drifting or moving forward when the player walks.

Because the generated report highlights a different symptom (vertical sinking) and omits the core behavior (horizontal shifting due to player movement), the two reports are not describing the same underlying bug.","match":false}

{"reasoning":"Ground truth bug concerns the player intersecting the side of a building so that the camera clips inside the building and shows the empty void behind its surfaces. The symptom is visual camera clipping inside a static structure, not the player falling through geometry.

The generated report describes a different problem: the player character’s collision with a wooden floor fails, causing the character to fall through the walkway and end up underneath it. The key symptom is falling through the floor, not camera clipping through walls. No mention of camera showing void inside walls.

Because the core behaviors (camera clipping vs. player falling) and circumstances (building wall vs. wooden floor) differ, these are not the same underlying bug.","match":false}

{"reasoning":"Ground truth focuses on a post-impact physics bug where the NPC, after being shot, is first grounded and then violently launched upward and sideways. The key symptom is the sudden, unrealistic projection into the air.

Generated report instead describes a collision issue in which the dead character’s body clips or falls through a chair, indicating missing collision detection with the chair. There is no mention of any upward/sideways launch or secondary force; the symptom is simply falling through furniture.

Because the core behaviors, visual outcomes, and involved objects differ (launching into air vs. clipping through chair), the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground-truth bug is about the character unexpectedly levitating out of the water and then becoming frozen/stuck in mid-air. The key symptoms are involuntary upward movement and a permanent frozen pose.

The generated report instead talks about the character intentionally emerging from water but clipping through vegetation and the water surface; it still performs its jump animation and does not mention getting stuck or frozen. The core issue in the generated report is missing collision, not a levitation/freeze state.

Because the main behaviors and problems described differ (levitation & freeze vs. clipping without freeze), the two reports do not refer to the same bug.","match":false}

{"reasoning":"Ground truth bug concerns two NPCs spawning or standing in exactly the same spot, then separating when the player attacks one of them. Key aspects: spatial overlap and post-attack separation.

Generated bug concerns an overseer NPC continuing to attack a slave while simultaneously fighting the player, i.e., incorrect target-priority logic. There is no mention of NPCs sharing the same position or separating after attack. Conversely, the ground-truth description has no mention of an overseer still attacking a slave while engaged with the player.

Because the core behaviors, symptoms, and conditions differ, the two reports do not describe the same underlying bug.","match":false}

{"reasoning":"The ground truth describes the bug very concisely: “A person is swimming in the air” – i.e., an avatar/character is in a swimming-like pose and moving while not in water. 

The generated report states that after exiting a vehicle, “the player character remains suspended in the air, floating horizontally … with an animation that appears to be a swimming or flying pose, rather than walking … .” This is effectively the same symptom: the character is in mid-air using a swimming animation. The extra detail about it happening after leaving a vehicle does not contradict the ground truth; it just adds context. The core erroneous behaviour (character swimming/floating in air) is identical.

Therefore, the generated report matches the ground truth description.","match":true}
